import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Container } from 'react-bootstrap';
function App() {
  return (
    <div className="App">
      <Container>
        <Button className='btn-flat'>
          click me
        </Button>
        <button>click</button>
      </Container>
    </div>
  );
}

export default App;
